    <div>
      <Menu inverted fixed="top" size="massive">
        <Container>
          <Image src="images/naxus12.PNG" size="small" />
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          <Menu.Item name="messages" />
          <Menu.Menu position="right">
            <Menu.Item>
              <Button.Group size="medium">
                <Button color='purple'>Cancel</Button>
                <Button.Or />
                <Button positive>Save</Button>
              </Button.Group>
            </Menu.Item>
          </Menu.Menu>
        </Container>
      </Menu>
    </div>

